import React, { Component } from 'react';
import SelectPanel from "./components/select/SelectPanel";
class SelectPanelPage extends Component<any, any> {
    render() {
        return (
                <div className={"flex flex-col justify-center items-center h-full w-full bg-amber-100"}>
                    <SelectPanel/>
                </div>
        );
    }
}

export default SelectPanelPage;
